package com.rankhep.woosong.modelclass User(var id:String, var pw:String, var token:String, var email:String, var username:String){    override fun equals(other: Any?): Boolean {        if (this === other) return true        if (javaClass != other?.javaClass) return false        other as User        if (id != other.id) return false        if (pw != other.pw) return false        if (token != other.token) return false        if (email != other.email) return false        if (username != other.username) return false        return true    }    override fun toString(): String {        return "User(id='$id', pw='$pw', token='$token', email='$email', username='$username')"    }    override fun hashCode(): Int {        var result = id.hashCode()        result = 31 * result + pw.hashCode()        result = 31 * result + token.hashCode()        result = 31 * result + email.hashCode()        result = 31 * result + username.hashCode()        return result    }}